ISLAMABAD, Apr 29 (APP): A third batch of 97 Pakistani nationals from Port Sudan arrived at Jinnah International Airport, Karachi from Jeddah via C-130 aircraft of Pakistan Air Force (PAF).
“The government of Pakistan will continue to facilitate the safe return of stranded Pakistanis,” Foreign Office spokesperson on Saturday posted on her Twitter handle.
